package test01;

public class star {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//1단계: 별로 사각형 만들기 2단계: 별로 박스 만들기 3단계: 별로 삼각형 박스 만들기
			
		for (int i=0; i<5; i ++) {
			for(int j=0; j<5; j++) {
				System.out.print('*');
			}
			System.out.print('\n');
		}
		
	}
	
}